import React, { Component } from "react";
import { Link } from "react-router-dom";

const liStyle = {
  display: "inline",
  margin: "100px 50px",
  fontFamily: "Tahoma"
};

const nameStyle = {
  backgroundColor: "grey",
  float: "left",
  padding: "25px 50px",
  fontSize: "2em",
  fontFamily: "Tahoma",
  display: "inline"
};

const listStyle = {
  display: "inline",
  margin: "100px 50px"
};

const listTextStyle = {
  textDecoration: "none",
  color: "black",
  padding: "10px 30px"
};

const headerStyle = {
  backgroundColor: "grey"
};

export class Menu extends Component {
  render() {
    return (
      <div>
        <header style={headerStyle}>
          Adam Pikielny
          <ul style={listStyle}>
            <li style={liStyle}>
              <Link style={listTextStyle} to="/code">
                Code
              </Link>
            </li>
            <li style={liStyle}>
              <Link style={listTextStyle} to="/videos">
                Videos
              </Link>
            </li>
            <li style={liStyle}>
              <Link style={listTextStyle} to="/photos">
                Photos
              </Link>
            </li>
          </ul>
        </header>
      </div>
    );
  }
}

export default Menu;
